size = len(staticCache) - 1


# ------------
# collatz_read
# ------------


def collatz_read(s):
    """
    read two ints
    s a string
    return a list of two ints, representing the beginning and end of a range, [i, j]
    """
    a = s.split()
    return [int(a[0]), int(a[1])]


# ------------
# collatz_eval
# ------------


def collatz_eval(i, j):
    """
    i the beginning of the range, inclusive
    j the end       of the range, inclusive
    return the max cycle length of the range [i, j]
    """
    maxSteps = 0
    steps = 0
    if i > j:
        i,j = j,i
    if i < size and j < size:             #--------------------------------------
        return max(staticCache[i:j+1])    # if both i and j are in the staticCache
    if i < size:                          # the maxSteps is simply the max of the
        maxSteps = max(staticCache[i:])   # the slice of staticCache
        i = size                          #--------------------------------------
    for n in range(i,j+1):
        try:                              #--------------------------------------
            steps = dynamicCache[n]       # try/except provides marginal performance
        except:                           # increase over "if/else x in staticCache".
            steps = getNewValue(n)        # getNewValue(n) finds the number of steps.
        if steps > maxSteps:              #--------------------------------------
            maxSteps = steps
    return maxSteps


# -------------
# getNewValue
# -------------
def getNewValue(x):
    """
    Recursive function which is called to 
    determine the Collatz steps for any 
    uncached integer encountered. Recursion
    allows all integers encountered on the 
    path from x to 1 to be cached dynamically
    in dynamicCache with their number of steps.
    """
    step = 1
    if x % 2 == 0:
        y = x >> 1
    else:
        y = x + (x >> 1) + 1
        step = 2
    if y < size:                                  #--------------------------------------
        dynamicCache[x] = step + staticCache[y]   # Checks if y is in the staticCache or
        return (step + staticCache[y])            # is a previously encounterd value in 
    if y in dynamicCache:                         # dynamicCache to shortcut to the answer.
        dynamicCache[x] = step + dynamicCache[y]  #--------------------------------------
        return (step + dynamicCache[y])
    dynamicCache[x] = getNewValue(y) + step       # Recursively calls getNewValue() if needed.
    return dynamicCache[x]


# -------------
# collatz_print
# -------------


def collatz_print(w, i, j, v):
    """
    print three ints
    w a writer
    i the beginning of the range, inclusive
    j the end       of the range, inclusive
    v the max cycle length
    """
    w.write(str(i) + " " + str(j) + " " + str(v) + "\n")


# -------------
# collatz_solve
# -------------


def collatz_solve(r, w):
    """
    r a reader
    w a writer
    """
    for s in r:
        if not s.strip():
            continue
        i, j = collatz_read(s)
        v = collatz_eval(i, j)
        collatz_print(w, i, j, v)